import { motion, useAnimationControls } from "framer-motion"
import estyle from "./OutlineVerticalRect.module.scss"
import { useEffect } from "react"

function OutlineVerticalRect({props}) {

    useEffect(() => {

        const sequence = async () => {
            await divControls.start('flash1')
            await divControls.start('flash2')
            await divControls.start('flash3')
            await divControls.start('flash4')
            await divControls.start('flash5')
            await divControls.start('flash6')
            await divControls.start('flash7')
            await divControls.start('flash8')
            await divControls.start('flash9')
        }

        sequence(whichone)
    })

    const divControls = useAnimationControls();

    const objanim1 = {
        ready: { opacity: 0, },
        // visible: { opacity: 1, transition: { delay: props.delay, duration: .3 }}

        flash1: { opacity: 1,
            transition: {
                opacity: {delay: props.delay + .5, duration: .05}
            }
        },
        flash2: { opacity: 0,
            transition: {
                opacity: {delay: 0, duration: .05}
            }
        },
        flash3: { opacity: 1,
            transition: {
                opacity: {delay: 0, duration: .05}
            }
        },
        flash4: { opacity: 0,
            transition: {
                opacity: {delay: 0, duration: .05}
            }
        },
        flash5: { opacity: 1,
            transition: {
                opacity: {delay: 0, duration: .05}
            }
        },
        flash6: { opacity: 0,
            transition: {
                opacity: {delay: 0, duration: .05}
            }
        },
        flash7: { opacity: 1,
            transition: {
                opacity: {delay: 0, duration: .05}
            }
        },
        flash8: { opacity: 0,
            transition: {
                opacity: {delay: 0, duration: .05}
            }
        },
        flash8: { opacity: 1,
            transition: {
                opacity: {delay: 0, duration: .05}
            }
        },
    }

    const objanim2 = {
        hidden: { opacity: 0 },
        visible: { opacity: 1, transition: { delay: props.delay + .2, duration: .8 }}
    }

    const objanim3 = {
        hidden: { opacity: 0 },
        visible: { opacity: 1, transition: { delay: props.delay + .7, duration: .5 }}
    }

    const objanim4 = {
        hidden: { opacity: 0 },
        visible: { opacity: 1, transition: { delay: props.delay + .5, duration: .3 }}
    }

    const objanim5 = {
        hidden: { opacity: 0 },
        visible: { opacity: 1, transition: { delay: props.delay + .8, duration: .8 }}
    }

    const objanim6 = {
        hidden: { opacity: 0 },
        visible: { opacity: 1, transition: { delay: props.delay + .4, duration: .3 }}
    }

    return (
        <div>
            <motion.svg width="106" height="12" viewBox="0 0 106 12" fill="none" xmlns="http://www.w3.org/2000/svg"

            >
                {/* <defs>
                    <clipPath id="myclippath">
                    <motion.rect 
                        height="200" 
                        width="500"
                        variants={startline}
                        initial="ready"
                        animate="start"
                    />
                    </clipPath>
                </defs> */}

                <motion.path
                variants={objanim1}
                initial="ready"
                animate={divControls}
                 d="M1.42688 0.772221L1.42688 10.7722H5.42661L5.42661 0.772221H1.42688Z" stroke={props.color} stroke-opacity="0.5" stroke-width="0.990389" stroke-miterlimit="1.5" stroke-linecap="round" stroke-linejoin="round"/>
                <motion.path 
                variants={objanim2}
                initial="hidden"
                animate="visible"
                d="M21.4269 0.772221V10.7722H25.4266V0.772221H21.4269Z" stroke={props.color} stroke-width="0.990389" stroke-miterlimit="1.5" stroke-linecap="round" stroke-linejoin="round"/>
                <motion.path 
                variants={objanim3}
                initial="hidden"
                animate="visible"
                d="M41.4269 0.772221V10.7722H45.4266V0.772221H41.4269Z" stroke={props.color} stroke-opacity="0.5" stroke-width="0.990389" stroke-miterlimit="1.5" stroke-linecap="round" stroke-linejoin="round"/>
                <motion.path 
                variants={objanim4}
                initial="hidden"
                animate="visible"
                d="M61.4269 0.772221V10.7722H65.4266V0.772221H61.4269Z" stroke={props.color} stroke-width="0.990389" stroke-miterlimit="1.5" stroke-linecap="round" stroke-linejoin="round"/>
                <motion.path 
                variants={objanim5}
                initial="hidden"
                animate="visible"
                d="M81.4269 0.772221V10.7722H85.4266V0.772221H81.4269Z" stroke={props.color} stroke-opacity="0.5" stroke-width="0.990389" stroke-miterlimit="1.5" stroke-linecap="round" stroke-linejoin="round"/>
                <motion.path 
                variants={objanim6}
                initial="hidden"
                animate="visible"
                d="M101.427 0.772221V10.7722H105.427V0.772221H101.427Z" stroke={props.color} stroke-opacity="0.5" stroke-width="0.990389" stroke-miterlimit="1.5" stroke-linecap="round" stroke-linejoin="round"/>
            </motion.svg>
        </div>
    )
}
export default OutlineVerticalRect;
